        def Matematica(self):
                def Trend():
                        n = len(self.v)
                        nrDescrescator, nrCrescator = 0, 0
                        for i in range(n - 1):
                                if self.v[i] > self.v[i + 1]:
                                        nrDescrescator += 1
                                else:
                                        nrCrescator += 1
                        if nrDescrescator > nrCrescator: return True
                        else: return False
                
                def Fluctuatii():
                        n = len(self.v)
                        fluctuatii = 0
                        if Trend():
                                for i in range(n - 1):
                                        if self.v[i] < self.v[i + 1]:
                                                fluctuatii += 1
                        else:
                                for i in range(n - 1):
                                        if self.v[i] > self.v[i + 1]:
                                                fluctuatii += 1
                        return fluctuatii
                                     
                def DeterminaSecventa(lungMax, startMax):
                        n = len(self.v)
                        lungCrt, startCrt = 0, 0
                        if Trend():
                                for i in range(0, n):
                                        if self.v[i] < self.v[i - 1]:
                                                lungCrt += 1
                                                if lungCrt > lungMax:
                                                        lungMax, startMax = lungCrt, startCrt
                                        else:
                                                lungCrt = 1
                                                startCrt = i
                        else:
                                for i in range(0, n):
                                        if self.v[i] > self.v[i - 1]:
                                                lungCrt += 1
                                                if lungCrt > lungMax:
                                                        lungMax, startMax = lungCrt, startCrt
                                        else:
                                                lungCrt = 1
                                                startCrt = i
                        return lungMax, startMax

                def Indicele():
                        return self.v[len(self.v) - 1] / self.v[0]
                
                def IndiceleMediu(I):
                        return pow(I, 1 / (len(self.v) - 1))
                
                def YAjustatIMediu(IMediu):
                        calc = 0
                        y = []
                        print("len(self.v) + int(self.lE2): ", len(self.v) + int(self.lineEdit_2.text()) + 1)
                        for i in range(1, len(self.v) + int(self.lineEdit_2.text()) + 1):
                                calc = self.v[0] * pow(IMediu, i - 1)
                                y.append(calc)
                        print("line_edit2: ", int(self.lineEdit_2.text()))
                        return y
                
                def YAjustatParabola():
                        ti = []
                        n = len(self.v)

                        if n % 2 == 0:
                                for i in range(n):
                                        ti.append((1 - n) + 2 * i)
                        else:
                                for i in range(n):
                                        ti.append(int((1 - n) / 2 + i))
                        
                        j, l, f, g, h = 0, 0, 0, 0, 0
                        for i in range(n):
                                j += ti[i] * ti[i]
                                l += ti[i] * ti[i] * ti[i] * ti[i]
                                f += self.v[i]
                                g += ti[i] * self.v[i]
                                h += ti[i] * ti[i] * self.v[i]
                        
                        a = (h * j - f * l) / (j * j - l * n)
                        b = g / j
                        c = (f * j - h * n) / (j * j - l * n)

                        print("a = ", a)
                        print("b = ", b)
                        print("c = ", c)

                        print("Functia arat: y = ", c, " * ti^2 + ", b, " * ti + ", a)

                        ti_pred = []
                        if len(ti) % 2 == 0:
                                ti_pred.append(ti[len(ti) - 1] + 2)
                                for i in range(int(self.lineEdit_2.text()) - 1):
                                        ti_pred.append(ti_pred[len(ti_pred) - 1] + 2)
                        else:
                                ti_pred.append(ti[len(ti) - 1] + 1)
                                for i in range(int(self.lineEdit_2.text()) - 1):
                                        ti_pred.append(ti_pred[len(ti_pred) - 1] + 1)
                        
                        print("ti_pred: ", ti_pred)
                        y_pred = []
                        for i in range(len(ti_pred)):
                                y_pred.append(c * ti_pred[i] * ti_pred[i] + b * ti_pred[i] + a)
                        
                        print("y_pred: ", y_pred)
                        return y_pred
                
                def ProbabilitateFluctuatii(nrFluctuatii):
                        if len(self.v) != 0:
                                return [1 - (nrFluctuatii) / (len(self.v) - 1), (nrFluctuatii) / (len(self.v) - 1)]
                        else:
                                return [0, 0]
                        
                def updateazaGraficul(chartView, chart, valori_prezise, esteIMediuSauParabola):
                        for i in range(len(valori_prezise)):
                                self.series.append(int(i), valori_prezise[i])
                        
                        chart.addSeries(self.series)
                        chart.createDefaultAxes()
                        if esteIMediuSauParabola:
                                chart.setTitle("Grafic pentru valorile prezise cu metoda Indicelui Mediu")
                        else:
                                chart.setTitle("Grafic pentru valorile prezise cu metoda Parabolii")
                        chartView.setRenderHint(QtGui.QPainter.Antialiasing)

                        self.verticalLayout_22.addWidget(chartView)

                        """
                        self.chart = QtChart.QChart()
                        self.chart.legend().hide()
                        self.chart.addSeries(self.series)
                        self.chart.createDefaultAxes()
                        self.chart.setTitle("grafic")

                        self.chartView = QtChart.QChartView(self.chart)
                        self.chartView.setRenderHint(QtGui.QPainter.Antialiasing)

                        self.verticalLayout_22.addWidget(self.chartView)
                        """

                if len(self.v) != 0:
                        cuIMediu, functieParabola = ProbabilitateFluctuatii(Fluctuatii())
                        cuIMediu = round(cuIMediu, 2)
                        functieParabola = round(functieParabola, 2)

                        if Trend():
                                print("[DEBUG]: Trendul este descrescator")
                        else:
                                print("[DEBUG]: Trendul este crescator")
                        
                        lungMax, startMax = DeterminaSecventa(0, 0)
                        print("[DEBUG]: Secventa de maxim este de lungime ", lungMax, " si incepe de la ", startMax)
                        for i in range(startMax, startMax + lungMax):
                                print(self.v[i], end=" ")
                        
                        print("Probabilitatea de a ajunge la o fluctuatie cu IMediu este:", cuIMediu)
                        print("Indicele este:", Indicele())
                        print("Indicele mediu este:", IndiceleMediu(Indicele()))
                        print("Y ajustat cu IMediu este:", YAjustatIMediu(IndiceleMediu(Indicele())))
                        YAjustatParabola()

                        self.label_13.setText("Datele introduse: " + str(self.v).split('[').pop().split(']')[0])
                        if Trend():
                                self.label_15.setText("Trendul dominant este: descrescator")
                        else:
                                self.label_15.setText("Trendul dominant este: crescator")
                        self.label_17.setText("Numărul de fluctuații din interval este: " + str(Fluctuatii()))
                        s = []
                        for i in range(len(self.v), len(self.v) + int(self.lineEdit_2.text())):
                                aux = YAjustatIMediu(IndiceleMediu(Indicele()))[i]
                                s.append(aux)
                
                        for k, i in enumerate(s):
                                if k == len(s) - 1:
                                        self.label_23.setText(self.label_23.text() + str(round(float(i), 2)) + " ")
                                else:
                                        self.label_23.setText(self.label_23.text() + str(round(float(i), 2)) + ", ")
                        
                        t = YAjustatParabola()

                        if t[0] < 0:
                                functieParabola = 0
                                cuIMediu = 1

                        cuIMediu = cuIMediu * 100
                        functieParabola = functieParabola * 100

                        self.label_19.setText(f"Probabilitatea pentru a determina valorile cu IMediu: {cuIMediu}%")
                        self.label_21.setText(f"Probabilitatea pentru a determina valorile cu Parabola: {functieParabola}%")
                        for k, i in enumerate(t):
                                if k == len(t) - 1:
                                        self.label_25.setText(self.label_25.text() + str(round(float(i), 2)) + " ")
                                else:
                                        self.label_25.setText(self.label_25.text() + str(round(float(i), 2)) + ", ")

                        if cuIMediu > functieParabola:
                                esteIMediuSauParabola = True
                                valori_totale_imediu = self.v + s
                                updateazaGraficul(self.chartView, self.chart, valori_totale_imediu, esteIMediuSauParabola)
                        else:
                                esteIMediuSauParabola = False
                                valori_totale_parabola = self.v + t
                                updateazaGraficul(self.chartView, self.chart, valori_totale_parabola, esteIMediuSauParabola)
                        
                        self.imediu = self.v + s
                        self.parabola = self.v + t
                        
                        self.v.clear()
                        s.clear()
                        t.clear()

